public String toString() {
  StringBuilder buf = new StringBuilder(MD5_LEN*2);
  for (int i = 0; i < MD5_LEN; i++) {
    int b = digest[i];
    buf.append(HEX_DIGITS[(b >> 4) & 0xf])
        .append(HEX_DIGITS[b & 0xf]);
  }
  return buf.toString();
}

